- input: "TEXT\x1CC00001305\x1C.TEXT\x1C\x1CF3XA\x1CResponse to FEC Letter dated Oct.
    16, 2009 in reference to August Monthly Report: Item 1- please see memo text for
    this entry; Item 2 - Activity for employees' salaries listed on Schedule H4, Line
    21(a) is less than 25% FEA, and description for each employee has been changed
    from 'salary' to 'salary-employee < 25% FEA'; Item 3 - Descriptions for 'political
    consulting fees' have been changed to reflect State activity and non-employee
    status; Item 4 - Reimbursements to Victory staff employees have been changed from
    Schedule H4, 21(a) disbursements to 30(b).  Payments to vendors over $200 have
    been itemized.  This will not affect funds transferred from non-federal account
    to Federal  for reimbursement, as only $85,000 of permissable $305,473.40 was
    transferred, as reflected on the Sept 20 Report; Item 5 - please see memo text
    for this entry.\n"
